import React from 'react'

export default class LogoContainer extends React.Component {

  render() {
    return (
      <>
        <div className="DRUMBLRLogo">
          DRUMBLR
        </div>
        <div className="MIDISoundsLogo">{this.props.midiSounds}</div>
      </>
    )
  }

}
